import React from 'react';

const HeroImage = () => {
  return (
    <div className="content flex-grow p-12 justify-center items-center">
      <img src="https://placehold.co/1500x750" alt="Fashion model with braided hair in a studio, dark-colored knitwear, close-up side profile view" className="max-w-full h-auto rounded-lg shadow-lg" />
    </div>
  );
};

export default HeroImage;
